import React from "react";
import './index.css';
import { Link } from 'react-router-dom';

const Navbutton = ({ buttonText },{ destination }) => (
<Link to="/{ destination }">
  <button className="navButton">
    {buttonText}
  </button>
  </Link>
);

export default Navbutton;
